artists.bio:
                    Colin Charles Greenwood (born on 26 June 1969, in Oxford) is a member of Radiohead. He usually plays the bass guitar and in latest albums he has taken to keyboards, samplers, and synthesizers. He is the older brother of fellow bandmember Jonny Greenwood. About his brother Jonny he says: &quot;Unlike the Gallaghers we beat each other up in private and get on very well in public ... It's really nice to be in a position where you're with a member of your family and you get on really well.&quot;  

        <a href="http://www.last.fm/music/Colin+Greenwood">Read more about Colin Greenwood on Last.fm</a>.


